import React from 'react';
import "../Asserts/Css/ComponentsCss/EmploymentProspectsabroad.css";
import EmploymentProspectsabroad from "../Asserts/images/EmploymentProspectsabroad.png";

const EmploymentProspectsAbroad = () => {
  return (
    <div >
      <div className="employmentprospectsabroadcomponents">
        {" "}
        <img className='employmentprospectsabroadimg' src={EmploymentProspectsabroad} width="320px" height="274px"></img>{" "}
        <p className="employmentprospectsabroadone"> Study abroad intakes </p>
        <p className='employmentprospectsabroadintakestwo'>Did you know academic year in universities abroad differ from the ones in India? Most universities offer two major intakes for the students aspiring to study abroad – Spring intake and fall intake. Let’s help you know all about it.</p>
      </div>{" "}
    </div>
  );
};

export default EmploymentProspectsAbroad;
